export default function t(){return{validate(t){if(t.value===""){return{valid:true}}const e=t.value.toUpperCase();if(!/^[0-9A-Z]{9}$/.test(e)){return{valid:false}}const r=e.split("").map(t=>{const e=t.charCodeAt(0);return e>="A".charCodeAt(0)&&e<="Z".charCodeAt(0)?e-"A".charCodeAt(0)+10+"":t});const a=r.length;let n=0;for(let t=0;t<a-1;t++){let e=parseInt(r[t],10);if(t%2!==0){e*=2}if(e>9){e-=9}n+=e}n=(10-n%10)%10;return{valid:n===parseInt(r[a-1],10)}}}}